class Solution {
    fun minimumCost(nums: IntArray, k: Int, dist: Int): Long {
        val n = nums.size
        val dp = Array(n + 1) { LongArray(k + 1) { Long.MAX_VALUE } }
        dp[0][0] = 0
        for (i in 1..n) {
            for (j in 1..k) {
                var minCost = Long.MAX_VALUE
                for (l in maxOf(i - dist - 1, 0)..i - 1) {
                    minCost = minOf(minCost, dp[l][j - 1] + nums[i - 1])
                }
                dp[i][j] = minCost
            }
        }
        return dp[n][k]
    }
}
